import './ranking.css'

export default function Ranking(props) {
    const [ranking, setRanking] = useState (
        () => JSON.parse(localStorage.getItem("ranking")) || []
      )
    
      useEffect(() => {
        localStorage.setItem("ranking", JSON.stringify(ranking))
    }, [ranking]) 
    
    
   
    
    return (
        {ranking}
    )
}
